import java.util.ArrayDeque;

public class Main {
    public static void main(String[] args) {
        ArrayDeque<Integer> deque = new ArrayDeque<>();
        /* other operations */
        int initVal = (int) Math.pow(3, 3);
        /* other operations */
        boolean halfDecision = (initVal % 3 == 0);
        /* other operations */
        if (halfDecision) {
            deque.addFirst(10);
        } else {
            deque.addLast(20);
        }
        /* other operations */
        deque.add(15);
        deque.add(25);
        deque.addLast(35);
        /* misleading operations that do not affect the read outcome */
        deque.removeFirst();
        deque.offer(40);
        if (deque.size() > 2) {
            deque.addFirst(5);
        }
        /* write */ deque.add(50); // This is the write point affecting the read point.
        /* other operations */
        deque.peekFirst();
        deque.addLast(deque.removeLast());
        if (!deque.isEmpty()) {
            deque.remove();
        }
        /* read */ int ret = deque.peekLast();
        System.out.println(ret);
    }
}
